<script setup lang="ts">
    import { useKYCStore } from '@/stores/kyc';
    import { useUserStore } from '@/stores/user';

    
    const { fetchKycStatus } = useKYCStore();
    const { kycItems } = storeToRefs(useKYCStore());
    const { userProfile } = storeToRefs(useUserStore());
    
    const activeStep = computed(() => {
        return kycItems.value.kyc.completed ? 'bankAccount' : 'personalDetails'
    });

    const startingDojahKyc: Ref<boolean> = ref(false);

    const { dojahAppId, dojahPublicKey, dojahWidgetId } = useRuntimeConfig().public;

    const { apiFetch } = useApiFetch();

    const showKycSubmittedModal: Ref<boolean> = ref(false);

    async function startDojahKyc(){
        if(!userProfile) {
            return;
        }

        if(kycItems.value.kyc.dojahInitiated) {
            showKycSubmittedModal.value = true;
            return;
        }

        startingDojahKyc.value = true;

        const result = await apiFetch('verifications/kyc', 'POST');

        if((result as any).success && !(result as any).error){

            const options = {
                app_id: dojahAppId,
                p_key: dojahPublicKey,
                type: 'custom',
    
                user_data: {
                    residence_country: 'NG',
                    email: userProfile.value?.email,
                    last_name: userProfile.value?.lastName,
                    first_name: userProfile.value?.firstName,
                },
                
                reference_id: (result as any).data.sessionReference,
                
                config: {
                    widget_id: dojahWidgetId
                },
    
                onSuccess: function (response: any) {
                    //   console.log('Success', response);
                    startingDojahKyc.value = false;
                    kycItems.value.kyc.dojahInitiated = true;
                    showKycSubmittedModal.value = true;
                    confirmDojahComplete();
                },
                
                onError: function (err: any) {
                    console.log('Error', err);
                    startingDojahKyc.value = false;
                },
            
                onClose: function () {
                    console.log('Widget closed');
                    startingDojahKyc.value = false;
                }
            };
            
            const connect = new Connect(options);
            
            connect.setup();

            
            connect.open();
        } else {
            // console.log((result as any).error);
        }
    }

    function kycBackToDashboard() {
        showKycSubmittedModal.value = false;
        confirmDojahComplete();
        navigateTo(
            '/dashboard',
            {
                external: true
            }
        );
    }
    
    async function confirmDojahComplete(){
        if(!kycItems.value.kyc.completed){
            setTimeout(async() => {
                await fetchKycStatus();
                confirmDojahComplete();
            }, 60000);
        }
    }
    
    const startingMonoKyc: Ref<boolean> = ref(false);
    
    const { monoConnect } = useAddBankAccount();

    function startMonoKyc(){
        startingMonoKyc.value = true;

        setTimeout(() => startingMonoKyc.value = false, 10000);

        monoConnect();
    }

    const emit = defineEmits<{
        '@stop-kyc-process': []
    }>();
</script>